import { useEffect, useState } from "react";
import HeadNav from "../Common/HeadNav";
import CandidateRow from "./CandidateRow";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";


function SearchCandidate() {


    const [Name, setName] = useState("name");

    useEffect(() => {

        const getName = sessionStorage.getItem("SearchingCandidateName");
        Name = JSON.parse(getName);
    }, []);

    const NameChange = (args) => {
        var copyofname = { ...loginDtl };

        copyofname[args.target.name] = args.target.value;
        setName(copyofname);
    }

    const history = useHistory();

    const ViewCandidate = () => {
        history.push("/CandidateProfile");
    }

    const [AllCandidate, setAllCandidate] = useState([{ FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }, { FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }, { FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }, { FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }, { FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }, { FirstName: "ritesh", LastName: "padalwar", Occupation: "Minister", Region: "phase 2" }]);
    return <>


        <HeadNav></HeadNav>


        <div class="jumbotron">
            <div class="container">
                <center>
                    <p>Search Candidate</p>
                </center>
            </div>
        </div>

        <div className="col-lg-3" ></div>
        <div className="col-lg-6" >
            <center>
                <input type="text" placeholder="Enter The Name or Region" className="form-control" name="name" value={Name.name} onChange={NameChange}></input>
                <br></br>
                <button className="btn btn-primary">Search</button>
            </center>
        </div>


        <div className="container-fluid text-center">

            <div className="row content">
                <div className="col-lg-12 sidenav">
                    <br></br><br></br>
                    <table className='table table-responsive'>
                        <tbody>
                            {
                                AllCandidate.map((candidate) => {
                                    return <CandidateRow key={candidate.FirstName}
                                        candidate={candidate}
                                        ViewCandidate={ViewCandidate}
                                    />
                                })
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        </div>



    </>
}

export default SearchCandidate;
